import React, { useContext } from 'react';
import { VoteContext } from './VoteContext';

const AdminPage = () => {
  const { handleVote } = useContext(VoteContext);

  const handleButtonClick = (status) => {
    handleVote(status);
  };

  return (
    <div>
      <h1>Halaman Admin</h1>
      <button onClick={() => handleButtonClick('masuk')}>Masuk</button>
      <button onClick={() => handleButtonClick('tidak')}>Tidak</button>
    </div>
  );
};

export default AdminPage;
